function deleteDoc(e){
  const t = $('#' + e); t.text() === 'Delete' ? t.text('Are You Sure?') : $.ajax({ url:'../api/auth-attempts/' + e,type:'DELETE',success:function (e){
    successAlert('Auth Attempt Deleted'),table.ajax.reload();
  },error:function (e){
    errorAlert(e.responseJSON.message);
  } });
}
